import React from "react";
import "./index.css";
import { useNavigate } from "react-router-dom";

function About() {
  const navigate = useNavigate();
  const goBack = () => {
    navigate("/");
  };

  return (
    <div className="mainContainer">
      This is the About Us Page <br />
      <button className="btn" onClick={() => goBack()}>
        Go Back
      </button>
    </div>
  );
}

export default About;
